import React from 'react';
const Modal = ({active, setActive}) => {
    return (
        <div>
            <div className={active ? 'modal__one active' : 'modal__one'}  onClick={() => setActive(false)}>
                <div className="container">
                    <div className={active ? 'modal_content system' : 'modal_content'} onClick={event => event.stopPropagation()}>
                        <div className="names__two">
                            <h1 className="euo_one ">У вас есть</h1>
                            <h1 className="euo"> дополнительные</h1>
                            <h1 className="euo">вопросы</h1>
                            <p className="pro">Оставьте вои контакты, мы перезвоним</p>
                            <input className="inputs" type="text" placeholder="Введите Ваше имя"/>
                            <input className="inputs" type="text" placeholder="Введите номер телефона"/>
                            <br/>
                            <button className="but-two-one">перезвоните мне</button>
                            <p className="sideshow">Мы перезвоним в течении дня</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Modal;
